import React from "react";

const About = () => {
  return (
    <section id="about" className="min-h-screen flex items-center justify-center px-4 bg-gray-50">
      <div className="max-w-3xl text-center">
        <h2 className="text-3xl md:text-4xl font-bold mb-4">About Me</h2>
        <p className="text-gray-700 mb-6">
          I'm a passionate front-end developer with a love for crafting beautiful, intuitive, and functional user interfaces.
          My work combines visual storytelling with clean, modern design.
        </p>
        <a
          href="/resume.pdf"
          className="text-blue-600 underline hover:text-blue-800"
          download
        >
          Download Resume
        </a>
      </div>
    </section>
  );
};

export default About;
